import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Tab, Tabs, Button } from 'react-bootstrap';
import StudentForm from './StudentForm';
import ExcelUpload from './ExcelUpload';
import SlotCreator from './SlotCreator';
import InterviewList from './InterviewList';
import { toast } from 'react-toastify';
import studentService from '../../services/studentService';
import slotService from '../../services/slotService';

const AdminDashboard = () => {
    const [students, setStudents] = useState([]);
    const [slots, setSlots] = useState([]);
    const [interviews, setInterviews] = useState([]);
    const [selectedStudents, setSelectedStudents] = useState([]);

    useEffect(() => {
        loadData();
    }, []);

    const loadData = async () => {
  try {
    const [studentsData, slotsData, interviewsData] = await Promise.all([
      studentService.getStudents(),
      slotService.getSlots(),
      interviewService.getInterviews()
    ]);
    console.log('Students:', studentsData);
    console.log('Slots:', slotsData);
    console.log('Interviews:', interviewsData);
    setStudents(studentsData);
    setSlots(slotsData);
    setInterviews(interviewsData);
  } catch (error) {
    toast.error('Failed to load data');
    console.error('Load data error:', error);
  }
};


    const handleStudentAdded = () => {
        loadData();
        toast.success('Student added successfully');
    };

    const handleExcelUploaded = (result) => {
        loadData();
        toast.success(`Excel processed: ${result.successful} successful, ${result.failed} failed`);
    };

    const handleSlotCreated = () => {
        loadData();
        toast.success('Interview slot created successfully');
    };

    const handleSendInvitations = async () => {
        if (selectedStudents.length === 0) {
            toast.warning('Please select students to send invitations');
            return;
        }

        try {
            await studentService.sendInvitations(selectedStudents);
            toast.success('Invitations sent successfully');
            setSelectedStudents([]);
        } catch (error) {
            toast.error('Failed to send invitations');
        }
    };

    return (
        <Container fluid className="py-4">
            <Row className="mb-4">
                <Col>
                    <h2>Interview Scheduler - Admin Dashboard</h2>
                </Col>
            </Row>

            <Tabs defaultActiveKey="students" className="mb-4">
                <Tab eventKey="students" title="Student Management">
                    <Row>
                        <Col md={6}>
                            <StudentForm onStudentAdded={handleStudentAdded} />
                        </Col>
                        <Col md={6}>
                            <ExcelUpload onExcelUploaded={handleExcelUploaded} />
                        </Col>
                    </Row>
                    
                    <Row className="mt-4">
                        <Col>
                            <div className="d-flex justify-content-between align-items-center mb-3">
                                <h5>Students List</h5>
                                <Button 
                                    variant="primary" 
                                    onClick={handleSendInvitations}
                                    disabled={selectedStudents.length === 0}
                                >
                                    Send Invitations ({selectedStudents.length})
                                </Button>
                            </div>
                            
                            <div className="table-responsive">
                                <table className="table table-striped">
                                    <thead>
                                        <tr>
                                            <th>
                                                <input
                                                    type="checkbox"
                                                    onChange={(e) => {
                                                        if (e.target.checked) {
                                                            setSelectedStudents(students.map(s => s.Id));
                                                        } else {
                                                            setSelectedStudents([]);
                                                        }
                                                    }}
                                                />
                                            </th>
                                            <th>Name</th>
                                            <th>Email</th>
                                            <th>Phone</th>
                                            <th>Resume</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {students.map(student => (
                                            <tr key={student.Id}>
                                                <td>
                                                    <input
                                                        type="checkbox"
                                                        checked={selectedStudents.includes(student.Id)}
                                                        onChange={(e) => {
                                                            if (e.target.checked) {
                                                                setSelectedStudents([...selectedStudents, student.Id]);
                                                            } else {
                                                                setSelectedStudents(selectedStudents.filter(id => id !== student.Id));
                                                            }
                                                        }}
                                                    />
                                                </td>
                                                <td>{student.Name}</td>
                                                <td>{student.Email}</td>
                                                <td>{student.Phone}</td>
                                                <td>
                                                    {student.ResumeLink && (
                                                        <a href={student.ResumeLink} target="_blank" rel="noopener noreferrer">
                                                            View Resume
                                                        </a>
                                                    )}
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>
                            </div>
                        </Col>
                    </Row>
                </Tab>

                <Tab eventKey="slots" title="Interview Slots">
                    <Row>
                        <Col md={4}>
                            <SlotCreator onSlotCreated={handleSlotCreated} />
                        </Col>
                        <Col md={8}>
                            <h5>Available Slots</h5>
                            <div className="table-responsive">
                                <table className="table table-striped">
                                    <thead>
                                        <tr>
                                            <th>Date & Time</th>
                                            <th>Status</th>
                                            <th>Booked By</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {slots.map(slot => (
                                            <tr key={slot.Id}>
                                                <td>{new Date(slot.SlotDateTime).toLocaleString()}</td>
                                                <td>
                                                    <span className={`badge ${slot.IsBooked ? 'bg-danger' : 'bg-success'}`}>
                                                        {slot.IsBooked ? 'Booked' : 'Available'}
                                                    </span>
                                                </td>
                                                <td>
                                                    {slot.IsBooked ? slot.StudentName : '-'}
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>
                            </div>
                        </Col>
                    </Row>
                </Tab>

                <Tab eventKey="interviews" title="Scheduled Interviews">
                    <InterviewList interviews={interviews} />
                </Tab>
            </Tabs>
        </Container>
    );
};

export default AdminDashboard;
